import * as Cards from "./Cards";
// add to one of questions new widget to put it by default

export const DefaultCardsForQ1 = [
  {
    name: Cards.TimeSpent.backEndName,
  },
  // {name: 'TestChart'},
  {
    name: Cards.Activities.backEndName,
  },
  {
    name: Cards.TopAps.backEndName,
  },
];
export const DefaultCardsForQ2 = [
  {
    name: Cards.Category.backEndName,
  },
];

export const DefaultCardsForQ3 = [
  {
    name: Cards.SQClasses.backEndName,
  },
  {
    name: Cards.SQLoc.backEndName,
  },
  {
    name: Cards.SQCoverage.backEndName,
  },
];
